import React from 'react';
import s from './Hint.module.css';

import close from './close.svg';

const Hint = (props) => {
  return (
      <div className={s.modal}>
        <div className={s.modal__content}>
          <span className={s.modal__text}>Инструкция по восстановлению пароля отправлена Вам на почту {props.email}
            <img className={s.modal__img} src={close} alt=""/>
          </span>
        </div>
      </div>
  );
};

export default Hint;
